import {
  Card3Container,
  CardSubText,
  CardText,
  CardButton,
  Container,
  ContainerCard,
} from "../Styles/Card.style";
import { Card } from "./Card";

const cards = [
  {
    title: "   Hydra||Dynmo",
    color: "#130e2d",
    subTitle: "5189  followers",
  },
  {
    title: "Get Out",
    color: "#130e2d",
    subTitle: "3267  followers",
  },
];

export const Card3 = () => {
  return (
    <>
      {cards.map((card) => (
        <Container>
          <img
            src="https://res.cloudinary.com/dvbw8xujd/image/upload/v1652636190/fc1_tzmngl.jpg"
            height="50px"
            width="50px"
          />
          <Card3Container
            className="padding"
            style={{ backgroundColor: card.color }}
          >
            <CardText>{card.title}</CardText>
            <CardSubText>{card.subTitle}</CardSubText>
          </Card3Container>
          <CardButton>Follow</CardButton>
        </Container>
      ))}
    </>
  );
};
